import styled from '@emotion/styled';
import Link from 'next/link';
import { useRouter } from ''

function Navigation() {
    return(
        <NavigationStyled>
            <ul>
                <li>
                    <Link href="#">
                        <a>Home</a>
                    </Link>
                    <Link href="#">
                        <a>Projects</a>
                    </Link>
                    <Link href="#">
                        <a>About</a>
                    </Link>
                    <Link href="#">
                        <a>Contact</a>
                    </Link>
                </li>
            </ul>
        </NavigationStyled>
    )
}

const NavigationStyled = styled.div`
    ul {
        list-style: none;
        padding: 0;
        margin: 0;
        display: flex;

        li {
            margin-left: 10px;
        }

        a {
            text-decoration: none;
            color: #ffffff;

            &:hover {
                text-decoration: underline;
            }

            &.active {
                color: #EF6800;
            }
        }
    }
`

export default Navigation;
